import React, { useState, useEffect } from "react";
import './Test.css'
import { Questions } from "./Questions";

var ped;

function predictWithMLModel(inputData) {
  fetch('http://127.0.0.1:5000/predict', {
      method: 'POST',
      headers: {
          'Content-Type': 'application/json'
      },
      body: JSON.stringify(inputData)
  })
  .then(response => response.json())
  .then(predictions => {
      // Handle the predictions received from the Flask backend
      ped = predictions;
      console.log('Predictions: by heet ', predictions);
  })
  .catch(error => {
      console.error('Error:', error);
  });

  return ped;
}


const inputData = [2, 100, 72, 100, 33.6,50];

function Test() {
  predictWithMLModel(inputData);
  const [index, setIndex] = useState(0);
  const [question, setQuestion] = useState(Questions[index]);
  const [selectedAnswer, setSelectedAnswer] = useState(null);
  const [floatInput, setFloatInput] = useState(0);
  const [result, setResult] = useState(false);
  const [isAnswered, setIsAnswered] = useState(false);

  useEffect(() => {
    setQuestion(Questions[index]);
    setIsAnswered(false);
    setSelectedAnswer(null);
  }, [index]);

  useEffect(() => {
    setIndex(0);
  }, []);

  const checkAns = (ans) => {
    setSelectedAnswer(ans);
    setIsAnswered(true);
  };

  const handleFloatInput = (e) => {
    setFloatInput(parseFloat(e.target.value));
    setIsAnswered(true); 
  };

  const reset = () => {
    setIndex(0);
    setSelectedAnswer(null);
    setFloatInput(0);
    setResult(false);
  };

  const next = () => {

    if (index === Questions.length - 1) {
      setResult(true);
      return;
    }
    setIndex(prevIndex => prevIndex + 1);
  };

  const prev = () => {
    if (index > 0) {
      setIndex(prevIndex => prevIndex - 1);
    }
  };

  return (
    <div className="container">
      <h1>Diabetes Prediction Test</h1>
      <hr />
      {result ? (
        <>
          <h2>Test is submitted successfully</h2>
          <h2>Congrats you have diabetes</h2>
          <h2>with prob {ped}</h2>
          <button className="reset" onClick={reset}>Reset</button>
        </>
      ) : (
        <>
          {index === 0 ? (
            <>
              <h2>{index+1}. {question.question}</h2>
              <input
                type="range"
                min={0}
                max={100}
                step={0.1}
                value={floatInput}
                onChange={handleFloatInput}
              />
              <p>Age: {floatInput.toFixed(1)} years</p>
              <button className="next" onClick={next} disabled={!isAnswered}>Next</button>
              <div className="index">{index+1} of {Questions.length} questions</div>
            </>
          ) : (
            <>
              <h2>{index+1}. {question.question}</h2>
              <ul>
                {Object.keys(question).filter(key => key.startsWith("option")).map((option, i) => (
                  <li
                    key={option}
                    className={selectedAnswer === i + 1 ? "selected" : ""}
                    onClick={() => checkAns(i + 1)}
                  >
                    {question[option]}
                  </li>
                ))}
              </ul>
              <button className="prev" onClick={prev}>Previous</button>
              <button className="next" onClick={next} disabled={!isAnswered}>Next</button>
              <div className="index">{index+1} of {Questions.length} questions</div>
              {selectedAnswer !== null }
            </>
          )}
        </>
      )}
    </div>
  );
}

export default Test;
